.table-container >>> .el-table--border th:nth-last-child(2) {
    border-right: 1px solid #d3dae0 !important;
}
.table-container >>> .el-table__row .el-input__inner {
    border: none !important;
    border-radius: 0;
}
.app-container >>> .el-dialog {
    min-width: 800px;
}
.filter-container >>> .el-input__inner {
    height: 32px;
    line-height: 32px;
}
.filter-container >>> .el-input-group__append {
    background-color: #fff;
}
.filter-container >>> .el-input-group__append .el-button {
    vertical-align: middle;
}
.filter-container .filter-items > .el-button,
.filter-container .filter-items > .el-input,
.filter-container .filter-items > .el-select,
.filter-container .filter-items > .el-date-editor {
    vertical-align: top;
    margin-bottom: 0;
}
.filter-container {
    padding-bottom: 5px;
}
